const SignIn = () => {
	return (
			<form className="sign-in-form">
                <FormInput type={"email"} placeholder="email"/>
                <FormInput type={"password"} placeholder="password"/>
                <button className="sign-">Sign in</button>
            </form>

	);
};

export default SignIn;
